import React from 'react';

import './App.css';
import Header from "./Components/Header/Header";

let categories: object[] = [
    {
        category: 'СЕТЫ',
        link:'sets'
    },
    {
        category: 'РОЛЛЫ',
        link: "rolls"
    },
    {
        category: 'СУШИ',
        link: 'sushi'
    },
    {
        category: 'ПИЦЦА',
        link: 'pizza'
    },
    {
        category: 'САЛАТЫ',
        link: 'salads'
    },
    {
        category: 'БУРГЕРЫ',
        link: 'burgers'
    },
    {
        category: 'ВОКИ',
        link: 'woks'
    },
    {
        category: 'СУПЫ',
        link: 'soups'
    },
    {
        category: 'ГАРНИРЫ',
        link: 'garnish'
    },
    {
        category: 'НАПИТКИ',
        link: 'drinks'
    },
    {
        category: 'ПОКЕ',
        link: 'pokes'
    }]


function App() {
    return (
        <div className="App">
            <Header categories={categories}/>

        </div>
    );
}

export default App;
